import React from 'react'
import Link from 'next/link'

import Attraction from '../components/Attraction'



type attr = {
        id: number,
        location_lng: number,
        location_lat: number,
        opening_hours: number[],
        created: string,
        source: string,
        name: string,
        address: string,
        rating: number,
        number_of_reviews: number,
        about: number,
        tags: string[],
        main_photo_url: string
        order_page: any,
        is_free: boolean,
        price: any
}

const indexPage = () => {
        const json: attr[] = require('../data/attractions_museums_tlv.json')
        return (

                <div>
                        <h1>Hello Bridgify!! :)</h1>
                        <p>go to <Link href="/auth"><a>Auth</a></Link></p>
                                {json.map(attr =>
                                        <Attraction key={attr.id}
                                                name={attr.name}
                                                number_of_reviews={attr.number_of_reviews}
                                                rating={attr.rating}
                                                tags={attr.tags}
                                        ></Attraction>)}
                </div>
        )
}


export default indexPage

//  1. Create an index web page which contains a designed list of attractions
// a.import JSON file
// b. map it into components
// c. design the components
